import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Profile.css';

const Profile = () => {
  const [userData, setUserData] = useState({
    name: '',
    email: '',
    bio: '',
    profilePicture: '',
    favoriteGames: []
  });

  const [formData, setFormData] = useState({
    bio: '',
    profilePicture: null,
    favoriteGames: []
  });

  useEffect(() => {
    axios.get('http://localhost:3001/profile', { withCredentials: true })
      .then((response) => {
        setUserData(response.data);
        setFormData({ bio: response.data.bio, profilePicture: null, favoriteGames: response.data.favoriteGames || [] });
      })
      .catch((error) => {
        console.error('Error fetching user data:', error);
      });
  }, []);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData({
      ...formData,
      [name]: files ? files[0] : value
    });
  };

  const handleFavoriteGamesChange = (e) => {
    const { options } = e.target;
    const selectedGames = Array.from(options).filter(option => option.selected).map(option => option.value);
    setFormData({
      ...formData,
      favoriteGames: selectedGames
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const dataToSend = new FormData();
    dataToSend.append('bio', formData.bio);
    if (formData.profilePicture) {
      dataToSend.append('profilePicture', formData.profilePicture);
    }
    dataToSend.append('favoriteGames', JSON.stringify(formData.favoriteGames));

    try {
      const response = await axios.put('http://localhost:3001/profile', dataToSend, {
        headers: {
          'Content-Type': 'multipart/form-data'
        },
        withCredentials: true
      });
      setUserData(response.data);
    } catch (error) {
      console.error('Error updating profile:', error);
    }
  };

  return (
    <div className='profile-container'>
      <h2>Profile</h2>
      <div className='profile-info'>
        <img src={`http://localhost:3001/${userData.profilePicture}`} alt="Profile" className='profile-picture' />
        <p>Name: {userData.name}</p>
        <p>Email: {userData.email}</p>
        <p>Bio: {userData.bio}</p>
        <div className='favorite-games'>
          <h3>Favorite Games</h3>
          <ul>
            {userData.favoriteGames.map((game, index) => (
              <li key={index}>{game}</li>
            ))}
          </ul>
        </div>
      </div>
      <form onSubmit={handleSubmit} encType='multipart/form-data'>
        <div className='form-group'>
          <label>Update Bio:</label>
          <textarea
            name='bio'
            value={formData.bio}
            onChange={handleChange}
            rows='4'
          />
        </div>
        <div className='form-group'>
          <label>Update Profile Picture:</label>
          <input
            type='file'
            name='profilePicture'
            onChange={handleChange}
          />
        </div>
        <div className='form-group'>
          <label>Select Favorite Games:</label>
          <select
            name='favoriteGames'
            multiple
            value={formData.favoriteGames}
            onChange={handleFavoriteGamesChange}
          >
            <option value='League of Legends'>League of Legends</option>
            <option value='Valorant'>Valorant</option>
            <option value='Apex Legends'>Apex Legends</option>
            <option value='Rocket League'>Rocket League</option>
            <option value='Rainbow Six Siege'>Rainbow Six Siege</option>
            <option value='Counter Strike 2'>Counter Strike 2</option>
            <option value='Warzone'>Warzone</option>
            <option value='Fortnite'>Fortnite</option>
            <option value='Overwatch 2'>Overwatch 2</option>
          </select>
        </div>
        <button type='submit' className='btn save-btn'>Save Changes</button>
      </form>
    </div>
  );
};

export default Profile;
